import React, { useState, useEffect } from 'react';
import './guestbook.css';

function Guestbook() {
  const [posts, setPosts] = useState([])

  useEffect(() => {
    window.scrollTo(0, 0)
    window.scrollTo = function () {};
  }, [])

  return (
    <div style={{overflow: "scroll" }}>
      <header style={{display: 'flex', flexDirection: 'column', alignItems: 'center'}}>
        <h1 id="title">33chan</h1>
        <p style={{width: '400px', textAlign: 'center'}}><i>33chan is Darigo's anonymous imageboard guestbook.</i></p>
        <form style={{maxWidth: "fit-content"}}>
          <input placeholder='Your name...' type="text"></input><br />
          <input placeholder='Subject...' type="text"></input><br />
          <textarea placeholder='Say hi!' rows={5} cols={28}></textarea><br />
          <input type='file'></input><br />
          <input type='submit'></input>
        </form>
      </header>
      <hr />

    </div>
  );
}

export default Guestbook;
